import React from 'react'
import Card  from 'react-bootstrap/Card'


const CategoryCard = (props)=>{
    return(
        <Card>
            <Card.Img variant="top" src={props.img} />
            <Card.Body>
                <Card.Text>
                {props.category}
                </Card.Text>
            </Card.Body>
        </Card>
    )
}

export default CategryCard;
